import React from "react";
import sell from "../images/sell.png"
import "./Sell.css"

const Sell = () => { 
    return (
    <>
        <div className="sell">
            <p>Sell or Rent Your Home</p>
        </div>
        <div className="list">
            <div className="listing">
                <h2>Post rental listings to reach millions of renters</h2>
                <p>Lets check</p>   
            </div>
        </div>
    </>
    ) 
}

export default Sell;
